// SPDX-License-Identifier: MIT
pragma solidity >0.7.0 <0.9.0;

contract Donaciones {
    address public owner;

    mapping(address => uint256) public balance;
    mapping(address => bool) public donantesUnicos;

    struct Donacion {
        address donante;
        uint256 cantidad;
    }

    Donacion[] public donaciones;

    event DonacionRealizada(address indexed donante, uint256 cantidad);

    constructor() {
        owner = msg.sender;
    }

    // Método receive para recibir donaciones directas
    receive() external payable {
        _registrarDonacion(msg.sender, msg.value);
    }

    // Método donar para hacer una donación usando una función explícita
    function donar() external payable {
        _registrarDonacion(msg.sender, msg.value);
    }

    // Función interna para registrar una donación, usada por recibir y donar
    function _registrarDonacion(address _donante, uint256 _cantidad) internal {
        donaciones.push(Donacion(_donante, _cantidad));
        balance[_donante] += _cantidad;

        if (!donantesUnicos[_donante]) {
            donantesUnicos[_donante] = true;
        }

        emit DonacionRealizada(_donante, _cantidad);
    }

    // Resumen total y número de donantes únicos
    function obtenerResumen() external view returns (uint256 totalDonaciones, uint256 numDonantes) {
        totalDonaciones = address(this).balance;
        numDonantes = donaciones.length;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Sin permisos");
        _;
    }

    // Método para retirar los fondos acumulados
    function retirarFondos() external onlyOwner {
        uint256 totalBalance = address(this).balance;
        (bool success, ) = owner.call{value: totalBalance}("");
        require(success, "Transferencia fallida");
    }
}

